@pytest.mark.slow
class TestFlowNodeFlowApiCalls(TestCase):
    api = FlowNodeApi
    addresses = ['f919ee77447b7497',
                 '0x6c36d50dd512ef8e',
                 'ecfad18ba9582d4f']
    txs_hash = ['c7851221b77faa84c78fabbb237c3de7f38b49d1f08880b2bcaca9976649e331',
                'c3105df17a70fdf075e411e3377867668fb0c94044dbd18d56f9338ec0449d61',
                '73603f93e5081ba05ee1cd319e9ce410898f19e9972f2b71641f04338a5d5546'
                ]

    @classmethod
    def check_general_response(cls, response, keys):
        if set(response.keys()).issubset(keys):
            return True
        return False

    def test_get_balance_api(self):
        first_layer_balance_keys = {'address', 'balance', '_expandable', '_links'}
        expandable_keys = {'contracts', 'keys'}
        links_keys = {'_self'}
        for address in self.addresses:
            get_balance_result = self.api.get_balance(address)
            assert self.check_general_response(get_balance_result, first_layer_balance_keys)
            assert self.check_general_response(get_balance_result.get('_expandable'), expandable_keys)
            assert self.check_general_response(get_balance_result.get('_links'), links_keys)
            assert type(get_balance_result.get('balance')) == str

    def test_get_block_head_api(self):
        get_block_head_response = self.api.get_block_head()
        first_layer_block_head_keys = {'header', 'block_status', '_expandable', '_links'}
        header_keys = {'id', 'parent_id', 'height', 'timestamp', 'parent_voter_signature'}
        expandable_keys = {'payload', 'execution_result'}
        links_keys = {'_self'}
        assert self.check_general_response(get_block_head_response[0], first_layer_block_head_keys)
        assert self.check_general_response(get_block_head_response[0].get('_expandable'), expandable_keys)
        assert self.check_general_response(get_block_head_response[0].get('_links'), links_keys)
        assert self.check_general_response(get_block_head_response[0].get('header'), header_keys)
        assert type(get_block_head_response[0].get('header').get('height')) == str

    def test_get_tx_details_api(self):
        tx_details_keys = {'block_id', 'collection_id', 'execution', 'status', 'status_code', 'error_message',
                           'computation_used', 'events', '_links'}
        links_keys = {'_self'}
        event_keys = {'type', 'transaction_id', 'transaction_index', 'event_index', 'payload'}
        for tx_hash in self.txs_hash:
            get_tx_details_response = self.api.get_tx_details(tx_hash)
            assert self.check_general_response(get_tx_details_response, tx_details_keys)
            assert self.check_general_response(get_tx_details_response.get('_links'), links_keys)
            if len(get_tx_details_response.get('events')):
                for event in get_tx_details_response.get('events'):
                    assert self.check_general_response(event, event_keys)

    def test_get_batch_block_txs_api(self):
        block_keys = {'block_id', 'block_height', 'block_timestamp', 'events'}
        event_keys = {'type', 'transaction_id', 'transaction_index', 'event_index', 'payload'}
        get_batch_block_txs_response = self.api.get_batch_block_txs(67988139, 67988145)
        assert len(get_batch_block_txs_response) != 0
        for block_txs in get_batch_block_txs_response:
            assert self.check_general_response(block_txs, block_keys)
            if block_txs.get('events'):
                for event in block_txs.get('events'):
                    assert self.check_general_response(event, event_keys)


class TestFlowNodeFlowFromExplorer(TestCase):
    api = FlowNodeApi

    # test for balances in order of normal, address with 0x, over 1000 with other asset
    addresses = ['f919ee77447b7497',
                 '0x6c36d50dd512ef8e',
                 'ecfad18ba9582d4f']

    # test for tx details in order of normal ,multiple_event, generated tx to test same value fee multiple event
    txs_hash = ['c7851221b77faa84c78fabbb237c3de7f38b49d1f08880b2bcaca9976649e331',
                'c3105df17a70fdf075e411e3377867668fb0c94044dbd18d56f9338ec0449d61',
                '73603f93e5081ba05ee1cd319e9ce410898f19e9972f2b71641f04338a5d5546'
                ]

    def test_get_balance(self):
        balance_mock_responses = [{'_expandable': {'contracts': 'contracts', 'keys': 'keys'},
                                   '_links': {'_self': '/v1/accounts/f919ee77447b7497'}, 'address': 'f919ee77447b7497',
                                   'balance': '63999900'},
                                  {'_expandable': {'contracts': 'contracts', 'keys': 'keys'},
                                   '_links': {'_self': '/v1/accounts/6c36d50dd512ef8e'}, 'address': '6c36d50dd512ef8e',
                                   'balance': '106329'},
                                  {'_expandable': {'contracts': 'contracts', 'keys': 'keys'},
                                   '_links': {'_self': '/v1/accounts/ecfad18ba9582d4f'}, 'address': 'ecfad18ba9582d4f',
                                   'balance': '239632733694'}]
        self.api.request = Mock(side_effect=balance_mock_responses)
        FlowExplorerInterface.balance_apis[0] = self.api
        balances = BlockchainExplorer.get_wallets_balance({'FLOW': self.addresses}, Currencies.flow)
        expected_balances = [
            {'address': 'f919ee77447b7497', 'balance': Decimal('0.63999900'), 'received': Decimal('0.63999900'),
             'rewarded': Decimal('0'), 'sent': Decimal('0')},
            {'address': '0x6c36d50dd512ef8e', 'balance': Decimal('0.00106329'), 'received': Decimal('0.00106329'),
             'rewarded': Decimal('0'), 'sent': Decimal('0')},
            {'address': 'ecfad18ba9582d4f', 'balance': Decimal('2396.32733694'), 'received': Decimal('2396.32733694'),
             'rewarded': Decimal('0'), 'sent': Decimal('0')}]
        for balance, expected_balance in zip(balances.get(Currencies.flow), expected_balances):
            assert balance == expected_balance

